import { useEffect, useState } from "react"
import {getRooms} from "../"


function Rooms(){

    const [rooms, setRooms] = useState([])

    useEffect(async()=>{
        const {rooms} = await getRooms()
    },[])


    return <>
    <h1 className ="header text-center">Chat Rooms</h1>
    </>
}

export default Rooms
